class Solution:
    def maximumValueSum(self, board: List[List[int]]) -> int:
        m, n = len(board), len(board[0])
        arr = []
        ans = -1 << 60
        r = []
        for i in range(m):
            r.append(sorted([[board[i][j], j] for j in range(n)], reverse=True)[:3])

        print(r)
        for i in range(m):
            for j in range(i+1, m):
                for k in range(j+1, m):
                    for a, x in r[i]:
                        for b, y in r[j]:
                            for c, z in r[k]:
                                if x != y and x != z and y != z:
                                    ans = max(ans, a + b + c)
        return ans
